  false,\n\t\"url\": null,\n\t\"notes\": \"This theme is a scanned and rectified version
  of the Minnesota DNR - Division of Waters \"Public Waters Inventory\" (PWI) maps.
  DNR Waters utilizes a small scale county map to \"visually\" show the general location
  of the public waters and public waters wetlands (lakes, wetlands, and watercourses)
  it has regulatory jurisdiction over. The regulatory \"boundary\" of these waters
  and wetlands is called the ordinary high water level (OHWL), which is determined
  by DNR Waters personnel in the field.\",\n\t\"license_title\": null,\n\t\"extras\":
